import React from "react";

import {
	Container,
	Cabecalho,
	Titulo,
	BotaoCriar,
	Conteudo,
	Perfil,
	FormularioEdicao,
} from "./PerfilUsuarioElementos";

const PerfilUsuario = () => {
	return (
		<Container>
			<Cabecalho>
				<Titulo>Editar Perfil</Titulo>
				<BotaoCriar>Criar</BotaoCriar>
			</Cabecalho>

			<Conteudo>
				<Perfil>
					<PerfilCabecalho></PerfilCabecalho>
					<PerfilInfo></PerfilInfo>
				</Perfil>
				<FormularioEdicao></FormularioEdicao>
			</Conteudo>
		</Container>
	);
};

export default PerfilUsuario;
